import React from "react";
import InputForm from "./InputForm";

const specificationForm = ({ handleChange, ...props }) => {
    const { specification } = props;
    return (
        <div id="specification-form" className="form-group">
            <div className="form-row from-group">
                <InputForm
                    name="amountToRequest"
                    label="amountToRequest"
                    type="text"
                    handleChange={this.handleChange}
                    value={this.amountToRequest}
                    className="col"
                />
                <InputForm
                    name="destinationType"
                    label="Destination Type"
                    type="text"
                    handleChange={this.handleChange}
                    value={this.destinationType}
                />
                <InputForm
                    name="presentation"
                    label="presentation"
                    type="text"
                    handleChange={handleChange}
                    value={specification.presentation}
                    className="col"
                />
                <InputForm
                    name="measurementType"
                    label="measurementType"
                    type="text"
                    handleChange={handleChange}
                    value={specification.measurementType}
                    className="col"
                />
                <InputForm
                    name="dimensions"
                    label="dimensions"
                    type="text"
                    handleChange={handleChange}
                    value={specification.dimensions}
                    className="col"
                />
                <InputForm
                    name="quantityPresentation"
                    label="quantityPresentation"
                    type="text"
                    handleChange={handleChange}
                    value={specification.quantityPresentation}
                    className="col"
                />
                <InputForm
                    name="price"
                    label="price"
                    type="text"
                    handleChange={handleChange}
                    value={specification.price}
                    className="col"
                />
                <InputForm
                    name="supplier"
                    label="supplier"
                    type="text"
                    handleChange={handleChange}
                    value={specification.supplier}
                    className="col"
                />
            </div>
        </div>
    );
};

export default specificationForm;
